/* nnom model */
static int8_t nnom_input_data[756];
static int8_t nnom_output_data[35];
static nnom_model_t* nnom_model_create(void)
{
	static nnom_model_t model;
	nnom_layer_t* layer[15];

	new_model(&model);

	layer[0] = Input(shape(63, 12, 1), nnom_input_data);
	layer[1] = model.hook(Conv2D(16, kernel(5, 5), stride(1, 1), PADDING_VALID, &conv2d_1_w, &conv2d_1_b), layer[0]);
	layer[2] = model.active(act_relu(), layer[1]);
	layer[3] = model.hook(Conv2D(32, kernel(3, 3), stride(1, 1), PADDING_VALID, &conv2d_2_w, &conv2d_2_b), layer[2]);
	layer[4] = model.active(act_relu(), layer[3]);
	layer[5] = model.hook(MaxPool(kernel(2, 1), stride(2, 1), PADDING_VALID), layer[4]);
	layer[6] = model.hook(Conv2D(64, kernel(3, 3), stride(1, 1), PADDING_VALID, &conv2d_3_w, &conv2d_3_b), layer[5]);
	layer[7] = model.active(act_relu(), layer[6]);
	layer[8] = model.hook(MaxPool(kernel(2, 1), stride(2, 1), PADDING_VALID), layer[7]);
	layer[9] = model.hook(Conv2D(32, kernel(3, 3), stride(1, 1), PADDING_SAME, &conv2d_4_w, &conv2d_4_b), layer[8]);
	layer[10] = model.active(act_relu(), layer[9]);
	layer[11] = model.hook(MaxPool(kernel(2, 1), stride(2, 1), PADDING_VALID), layer[10]);
	layer[12] = model.hook(Dense(35, &dense_1_w, &dense_1_b), layer[11]);
	layer[13] = model.hook(Softmax(), layer[12]);
	layer[14] = model.hook(Output(shape(35,1,1), nnom_output_data), layer[13]);
	model_compile(&model, layer[0], layer[14]);
	return &model;
}
